// Client configuration
const config = {
  clientName: 'HR Advice Online',
  fbAdAccountId: 'act_1504596024142925',
  sheetId: '1WKcbEPkbO-ljR5xJHURWMdg1ip6MiNwFsdmQK52hp6g',
  slackChannelId: 'C095KT33NNN'
};

// Get YESTERDAY's date (complete 24-hour period)
const yesterday = new Date();
yesterday.setDate(yesterday.getDate() - 1);
const dateStr = yesterday.toISOString().split('T')[0];

// Get date 5 days ago for 4-day average (yesterday - 4 days)
const fiveDaysAgo = new Date();
fiveDaysAgo.setDate(fiveDaysAgo.getDate() - 5);
const startDateStr = fiveDaysAgo.toISOString().split('T')[0];

return [{
  json: {
    ...config,
    dateToFetch: dateStr,
    avgStartDate: startDateStr
  }
}];

// Get data from all API calls
const insightsData = $('Fetch Yesterday\'s Ad Insights').all();
const config = $('Load Config').first().json;

// Try to get 4-day average data
let avgData = [];
try {
  avgData = $('Fetch 4-Day Average Data').all();
} catch (error) {
  console.log('Fetch 4-Day Average Data not available, skipping averages');
}

// Try to get status data
let statusData = [];
try {
  statusData = $('Fetch Ad Status').all();
} catch (error) {
  console.log('Fetch Ad Status node not available, continuing without status data');
}

// Create status lookup by ad ID
const statusMap = {};
if (statusData[0]?.json?.data) {
  statusData[0].json.data.forEach(ad => {
    statusMap[ad.id] = ad.status;
  });
}

// Create 4-day average lookup by ad ID
const avg4DayMap = {};
if (avgData[0]?.json?.data) {
  avgData[0].json.data.forEach(ad => {
    const totalSpend = parseFloat(ad.spend || 0);
    const totalImpressions = parseInt(ad.impressions || 0);
    const totalClicks = parseInt(ad.clicks || 0);

    // Extract link clicks and leads
    let totalLinkClicks = 0;
    let totalLeads = 0;

    if (ad.actions) {
      const linkClickAction = ad.actions.find(a => a.action_type === 'link_click');
      totalLinkClicks = linkClickAction ? parseInt(linkClickAction.value) : 0;

      const leadAction = ad.actions.find(action => 
        action.action_type === 'lead' || 
        action.action_type === 'offsite_conversion.fb_pixel_lead' ||
        action.action_type === 'omni_complete_registration' ||
        action.action_type === 'onsite_conversion.lead_grouped' ||
        action.action_type === 'leadgen_grouped'
      );
      totalLeads = leadAction ? parseInt(leadAction.value) : 0;
    }

    // Calculate 4-day averages for this ad (divide by 4 days)
    avg4DayMap[ad.ad_id] = {
      spend: (totalSpend / 4).toFixed(2),
      leads: (totalLeads / 4).toFixed(1),
      impressions: Math.round(totalImpressions / 4),
      linkClicks: Math.round(totalLinkClicks / 4),
      costPerLinkClick: totalLinkClicks > 0 ? (totalSpend / totalLinkClicks).toFixed(2) : 'N/A',
      cpl: totalLeads > 0 ? (totalSpend / totalLeads).toFixed(2) : 'N/A'
    };
  });
}

// Helper function to format numbers with commas
function formatNumber(num) {
  return num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
}

// Process insights data for yesterday
const processedAds = [];
let totalSpend = 0;
let totalLeads = 0;
let totalImpressions = 0;
let totalClicks = 0;
let totalLinkClicks = 0;

if (insightsData[0]?.json?.data) {
  insightsData[0].json.data.forEach(ad => {
    // Extract leads from actions array
    let leads = 0;
    let linkClicks = 0;

    if (ad.actions) {
      // Get leads
      const leadAction = ad.actions.find(action => 
        action.action_type === 'lead' || 
        action.action_type === 'offsite_conversion.fb_pixel_lead' ||
        action.action_type === 'omni_complete_registration' ||
        action.action_type === 'onsite_conversion.lead_grouped' ||
        action.action_type === 'leadgen_grouped'
      );
      leads = leadAction ? parseInt(leadAction.value) : 0;

      // Get link clicks
      const linkClickAction = ad.actions.find(a => a.action_type === 'link_click');
      linkClicks = linkClickAction ? parseInt(linkClickAction.value) : 0;
    }

    const spend = parseFloat(ad.spend || 0);
    const impressions = parseInt(ad.impressions || 0);
    const clicks = parseInt(ad.clicks || 0);

    // Calculate metrics
    const cpm = impressions > 0 ? (spend / impressions * 1000).toFixed(2) : '0.00';
    const cpc = clicks > 0 ? (spend / clicks).toFixed(2) : '0.00';
    const costPerLinkClick = linkClicks > 0 ? (spend / linkClicks).toFixed(2) : (ad.cost_per_inline_link_click || '0.00');
    const cpl = leads > 0 ? (spend / leads).toFixed(2) : '0.00';

    processedAds.push({
      date: config.dateToFetch,
      adId: ad.ad_id,
      campaignName: ad.campaign_name || 'Unknown Campaign',
      adsetName: ad.adset_name || 'Unknown Ad Set',
      adName: ad.ad_name || 'Unknown Ad',
      status: statusMap[ad.ad_id] || 'UNKNOWN',
      spend: spend.toFixed(2),
      leads: leads,
      impressions: impressions,
      clicks: clicks,
      linkClicks: linkClicks,
      cpm: cpm,
      cpc: cpc,
      costPerLinkClick: costPerLinkClick,
      cpl: cpl
    });

    totalSpend += spend;
    totalLeads += leads;
    totalImpressions += impressions;
    totalClicks += clicks;
    totalLinkClicks += linkClicks;
  });
}

// Sort by spend (highest first)
processedAds.sort((a, b) => parseFloat(b.spend) - parseFloat(a.spend));

// Build Top Performers section with 4-day average comparison
const topPerformers = processedAds.slice(0, 3).map((ad, i) => {
  const avg = avg4DayMap[ad.adId];
  let avgText = '';
  if (avg) {
    avgText = `\n   :calendar: 4-Day Avg: $${avg.spend} | ${avg.leads} leads | ${avg.linkClicks} link clicks | Cost/Link: $${avg.costPerLinkClick} | CPL: $${avg.cpl}`;
  }
  return `${i+1}. [${ad.adsetName}] ${ad.adName}\n   :moneybag: Yesterday: $${ad.spend} | :busts_in_silhouette: ${ad.leads} leads | ${ad.linkClicks} link clicks | Cost/Link: $${ad.costPerLinkClick} | CPL: $${ad.cpl}${avgText}`;
}).join('\n\n');

// Calculate yesterday's averages
const avgCPM = totalImpressions > 0 ? (totalSpend / totalImpressions * 1000).toFixed(2) : '0.00';
const avgCPC = totalClicks > 0 ? (totalSpend / totalClicks).toFixed(2) : '0.00';
const avgCostPerLinkClick = totalLinkClicks > 0 ? (totalSpend / totalLinkClicks).toFixed(2) : '0.00';
const avgCPL = totalLeads > 0 ? (totalSpend / totalLeads).toFixed(2) : 'N/A';

return [{
  json: {
    clientName: config.clientName,
    sheetId: config.sheetId,
    slackChannelId: config.slackChannelId,
    dateProcessed: config.dateToFetch,
    ads: processedAds,
    totalAds: processedAds.length,
    totalSpend: totalSpend.toFixed(2),
    totalLeads: totalLeads,
    totalImpressions: formatNumber(totalImpressions),
    totalClicks: totalClicks,
    totalLinkClicks: totalLinkClicks,
    avgCPM: avgCPM,
    avgCPC: avgCPC,
    avgCostPerLinkClick: avgCostPerLinkClick,
    avgCPL: avgCPL,
    topPerformersText: topPerformers
  }
}];

